import axios from 'axios'
const Register_path = "http://localhost:8000/register";
const Login_path = "http://localhost:8000/login";
const UserDetail_path = "http://localhost:8000/userdetails";

const ErrorMessage = () => {
    alert(<div><div class="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded relative" role="alert">
        <strong class="font-bold">Holy smokes!</strong>
        <span class="block sm:inline">Something seriously bad happened.</span>
        <span class="absolute top-0 bottom-0 right-0 px-4 py-3">
            <svg class="fill-current h-6 w-6 text-red-500" role="button" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 20 20"><title>Close</title><path d="M14.348 14.849a1.2 1.2 0 0 1-1.697 0L10 11.819l-2.651 3.029a1.2 1.2 0 1 1-1.697-1.697l2.758-3.15-2.759-3.152a1.2 1.2 0 1 1 1.697-1.697L10 8.183l2.651-3.031a1.2 1.2 0 1 1 1.697 1.697l-2.758 3.152 2.758 3.15a1.2 1.2 0 0 1 0 1.698z" /></svg>
        </span>
    </div></div>)
}
const SuccssMessage = () => {
    alert("Username already exists")
}
const Register = (data) => {
    return new Promise((resole, reject) => {
        axios.post(Register_path, data, {
            headers: {
                'Authorization': 'Bearer ' + localStorage.getItem('__sessionToken'),
                'Content-Type': 'application/json'
            }
        }).then(_response => {
            resole(_response);
            console.log(_response);
        }).catch(_error => {
            ErrorMessage(_error)
            reject(_error);
        });
    })

}
const Login = (data) => {
    return axios.post(Login_path, data, {
        headers: {
            'Authorization': 'Bearer ' + localStorage.getItem('__sessionToken'),
            'Content-Type': 'application/json'
        }
    })
}
export { Login, Register, UserDetail_path, ErrorMessage }
